Take control of your Mobily products and services with the all new Mobily App. Updated to include a modern, clean and highly intuitive look and feel, Mobily App streamlines your account management experience giving you fast access to all your important account info and more. With new features and improvements added regularly you’ll be able to do more than ever before.

Our great new features include:
•    Payments & Recharges Made Easy - Pay your bills and recharge easily using a variety of debit and credit cards through our smart and secure app;
•    Shopping on Demand - Get the latest smart phone, new line, sim, or fiber delivered right to you;
•    Simple Subscriptions - Find the best and latest offers on packages, services, and add-ons and quickly subscribe/unsubscribe with one click;
•    Delightfully Helpful Support - Talk to a real human through our social media support channels and sit back and relax whilst we take care of all your communication needs;
•    All Your Lines in One Place - Manage all your numbers under one account simply and securely.

And many more to come.
